    const {
      currentTarget: { value },
    } = event;
    setValue(value);
  }
  function onSubmit(event: React.FormEvent<HTMLFormElement>) {
    console.log(event);
  }
  return (
    <div>
      <form onSubmit={onSubmit}>
        <input
          value={value}
          type={"text"}
